import React, { useState } from 'react';
import TextField from '@material-ui/core/TextField';

function MyForm() {
  const [formData, setFormData] = useState({
    sl_no: '',
    customer_order_id: '',
    sales_org: '',
    distribution_channel: '',
    company_code: '',
    order_creation_date: '',
    order_amount: '',
    order_currency: '',
    customer_number: '',
    amount_in_usd: '',
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData((prevFormData) => ({
      ...prevFormData,
      [name]: value,
    }));
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Perform actions with form data
    console.log(formData);
  };

  const inputStyle = {
    backgroundColor: 'transparent',
    border: 'none',
    borderBottom: '1px solid #000',
  };

  return (
    <form onSubmit={handleSubmit}>
      <TextField
        label="sl_no"
        name="sl_no"
        value={formData.sl_no}
        onChange={handleChange}
        variant="outlined"
        style={inputStyle}
      />
      <br />
      <TextField
        label="customer_order_id"
        name="customer_order_id"
        value={formData.customer_order_id}
        onChange={handleChange}
        variant="outlined"
        style={inputStyle}
      />
      <br />
      <TextField
        label="sales_org"
        name="sales_org"
        value={formData.sales_org}
        onChange={handleChange}
        variant="outlined"
        style={inputStyle}
      />
      <br />
      <TextField
        label="distribution_channel"
        name="distribution_channel"
        value={formData.distribution_channel}
        onChange={handleChange}
        variant="outlined"
        style={inputStyle}
      />
      <br />
      <TextField
        label="company_code"
        name="company_code"
        value={formData.company_code}
        onChange={handleChange}
        variant="outlined"
        style={inputStyle}
      />
      <br />
      <TextField
        label="order_creation_date"
        name="order_creation_date"
        type="date"
        value={formData.order_creation_date}
        onChange={handleChange}
        variant="outlined"
        InputLabelProps={{ shrink: true }}
        InputProps={{
          style: inputStyle,
          inputProps: {
            style: {
              color: 'transparent',
            },
          },
        }}
      />
      <br />
      <TextField
        label="order_amount"
        name="order_amount"
        value={formData.order_amount}
        onChange={handleChange}
        variant="outlined"
        style={inputStyle}
      />
      <br />
      <TextField
        label="order_currency"
        name="order_currency"
        value={formData.order_currency}
        onChange={handleChange}
        variant="outlined"
        style={inputStyle}
      />
      <br />
      <TextField
        label="customer_number"
        name="customer_number"
        value={formData.customer_number}
        onChange={handleChange}
        variant="outlined"
        style={inputStyle}
      />
      <br />
      <TextField
        label="amount_in_usd"
        name="amount_in_usd"
        value={formData.amount_in_usd}
        onChange={handleChange}
        variant="outlined"
        style={inputStyle}
      />
      <br />
      <button type="submit">Submit</button>
    </form>
  );
}

export default MyForm;
